INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Quo totam iste non aliquam.', 'Repellendus tempora odio omnis natus voluptas et sed. Vero necessitatibus inventore illo fugiat nostrum excepturi. Ea dignissimos dolor ipsa sapiente neque. Ex hic numquam facilis in quae rerum rerum.', 'Saepe libero dolore maxime illum assumenda. Eveniet quia corrupti harum quas voluptates esse. Sed est consectetur quam enim sunt impedit. Voluptate iusto non voluptatem.', '1978-05-19');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Qui aut consectetur dicta ut minus.', 'Dolores velit sequi quo ad. Ut excepturi perferendis aut laboriosam sed. Eos quae perferendis ex aliquam at at dolorem.', 'Et debitis repudiandae quasi deleniti quia. Sit cupiditate voluptatum rerum tempore itaque incidunt voluptatem. Minus non aut maiores modi ullam. Qui id sed et in eligendi unde.', '1992-08-02');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Autem suscipit eos sit quis.', 'Architecto suscipit tenetur nostrum praesentium vel eligendi numquam omnis. Laudantium eveniet nostrum ipsum asperiores.', 'Debitis ipsam placeat totam distinctio quos. Minima molestias aut ut.', '1973-05-17');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Eum animi labore voluptates quia magnam.', 'Aut molestias quibusdam est vel et quas. Sed error ut ea odit. Ad corrupti beatae ut et. Expedita dolor minus sunt debitis non et quo.', 'Tempora qui quia asperiores aut inventore ut. Cum adipisci laborum iste accusamus commodi rem officia.', '1999-09-28');
